import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className="bg-black p-2">
      <nav className="container mx-auto flex justify-center items-center">
        <div className="flex items-center space-x-9 text-white" style={{fontSize: 'clamp(1rem, 1vw, 2rem)'}}>
          <Link to="/our-story" className="nav-link">our story</Link>
          <Link to="/events" className="nav-link">events</Link>
        </div>
          <div className="flex justify-center mx-9 text-white font-bold"  style={{fontSize: 'clamp(2rem, 2vw, 4rem)'}}>
            <Link to="/">
            the unplug club
            </Link>
          </div>
        <div className="flex items-center space-x-9 text-white" style={{fontSize: 'clamp(1rem, 1vw, 2rem)'}}>
          <Link to="/how-to-detox" className="nav-link">how to detox</Link>
          <Link to="/contact" className="nav-link">contact</Link>
        </div>
      </nav>
    </header>
  );
};

export default Header;
